import React from 'react';

function Food({name,image}){
  return (
  <div> 
    <h2>I like {name} </h2>
    <img src={image} alt = "food"/>
    
    </div>
  );
}

const foodILike = [
  {
    name : "jokbal",
    image: "data:image/jpeg;base64,"
  },
  {
    name : "beef",
    image : "data:image/jpeg;base64,"
  },
  {
    name : "rosti",
    image: "data:image/jpeg;base64,"
  }
];

function App() {
  return (
    <div className="App" >
      Hello!!
      {foodILike.map(dish => (

        <Food name={ dish.name } image = { dish.image }/>

      ))}
    </div>
  );
}

export default App;
